    return(
       <Container fluid className="p-0">
           <Naviagtion/>
           <Header title="test quiz" headline="checkout the quiz creation"/>

        <Container style={{color:'white'}} >
            Blog Stuff .....
        </Container>

       </Container>
    );
}

export default HomePage;
